// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

import "./CLHouse.sol";

/// @title A factory to deploy CLHouses easy
/// @author Leonardo Urrego
/// @notice This contract is only for test 
contract CLFactory {

    event evtHouseCreation( address houseAddr, string houseName, uint256 houseId );

	CLHouse[] public arrCLH;
    uint256 public numCLH = 0;
    mapping( address => uint256 ) public mapCLHId;     // TODO: remove
    address APICLH;
    address CLCMemberManagement;
    address CLCGovernance;
    address CLLConstructor;

    constructor( 
        address _CLCMemberManagement,
        address _CLCGovernance,
        address _CLLConstructor,
        address _APICLH
    ) {
        CLCMemberManagement = _CLCMemberManagement;
        CLCGovernance = _CLCGovernance;
        CLLConstructor = _CLLConstructor;
        APICLH = _APICLH;
        address[] memory _whiteListWallets = new address[] ( 3 );
        _whiteListWallets[0] = address( 0xc27480520A875bCa3874df1f533523E9ffdb1af9 ) ;
        _whiteListWallets[1] = address( 0x012775f98FDb33656f240A97f73a61f6B8C25756 ) ;
        _whiteListWallets[2] = address( 0xa7b59F12F19b96cc67f19eF017Cf9a0928910fD5 ) ;
        CreateCLH( {
            _houseName: "CLH #0",
            _housePrivate: false,
            _govModel: __GOV_COMMITTEE__,
            _govRules: [ 10, 99, 51 ],
            // _govRuleMaxManagerMembers: 1,
            // _govRuleMaxActiveMembers: 99,
            // _govRuleApprovPercentage: 100,
            _whiteListWallets: _whiteListWallets,
            _signerWallet: address( 0 ),
            _signature: ""
        } );
        numCLH--;
    }

    /// @notice Deploy a new copy of CLHouse
    /// @dev Some parameters can be ignored depending on the governance model
    /// @param _houseName Name of the CLH
    /// @param _housePrivate If is set to 1, the CLH is set to private
    /// @param _govModel keccak256 hash of the governance model, see the __GOV_* constans
    // / @param _govRuleMaxManagerMembers Max of manager member that CLH can accept (only for COMMITTEE )
    // / @param _govRuleMaxActiveMembers Max of all members (including managers)
    // / @param _govRuleApprovPercentage Percentage for approval o reject proposal based on `numManagerMembers`
    /// @param _whiteListWallets Whitelist of address for invitate as managers
    function CreateCLH(
        string memory _houseName,
        bool _housePrivate,
        bytes32 _govModel,
        uint8[3] memory _govRules,
        // uint8 _govRuleMaxManagerMembers,
        // uint8 _govRuleMaxActiveMembers,
        // uint8 _govRuleApprovPercentage,
        address[] memory _whiteListWallets,
        address _signerWallet,
        bytes memory _signature
    ) 
        // modCheckGov( _govModel )
        public
        returns( address )
    {
        CLHouse daoCLH;
        address houseOwner = msg.sender;

        require( 
            __GOV_DICTATORSHIP__ == _govModel ||
            __GOV_COMMITTEE__ == _govModel ||
            __GOV_SIMPLE_MAJORITY__ == _govModel ,
            "Invalid Governance Type"
        );

        if( _signerWallet != address(0) ) {
            require( _signature.length == 65, "NewCLH: Bad signature length" );

            require(
                _signerWallet == ApiCLHouse( APICLH ).SignerOCNewCLH(
                    _houseName,
                    _housePrivate,
                    _govModel,
                    _govRules[0], // _govRuleMaxManagerMembers,
                    _govRules[1], // _govRuleMaxActiveMembers,
                    _govRules[2], // _govRuleApprovPercentage,
                    _whiteListWallets[0],
                    address(this),
                    _signature
                ),
                "NewCLH: Invalid Signature"
            );

            houseOwner = _signerWallet;
        }


        daoCLH = ( new CLHouse )
        ( {
            _owner: houseOwner,
            _houseName: _houseName,
            _housePrivate: _housePrivate,
            _govModel: _govModel,
            _govRules: _govRules,
            // _govRuleMaxManagerMembers: _govRuleMaxManagerMembers,
            // _govRuleMaxActiveMembers: _govRuleMaxActiveMembers,
            // _govRuleApprovPercentage: _govRuleApprovPercentage,
            _CCL: [ CLCMemberManagement, CLCGovernance, CLLConstructor, APICLH ],
            // _CLCMemberManagement: CLCMemberManagement,
            // _CLCGovernance: CLCGovernance,
            // _CLLConstructor: CLLConstructor,
            _whiteListWallets: _whiteListWallets
        } );

        address adrCLH = address( daoCLH );
        uint256 houseId = arrCLH.length;
        arrCLH.push( daoCLH );
        numCLH++;
        mapCLHId[ adrCLH ] = houseId;

        emit evtHouseCreation( adrCLH, _houseName, houseId );

        return adrCLH;
    }

    /// @notice The list of all houses created by the factory
    /// @return arrCLH the array with all address
    function GetHouseList()
        external
        view
        returns(
            CLHouse[] memory
        )
    {
        return arrCLH;
    }

    /// @notice List of membership houses to one user
    /// @param _walletAddr The user address
    /// @return arrHouses List of address houses
    function GetHousesByUser(
        address _walletAddr
    )
        external
        view
        returns(
            address[] memory
        )
    {
        address[] memory arrHouses = new address[] ( arrCLH.length );
        uint256 indexarr = 0;
        for( uint256 did = 1 ; did <= numCLH ; did++ )
            if( 0 != arrCLH[ did ].mapIdMember( _walletAddr ) )
                arrHouses[ indexarr++ ] = address( arrCLH[ did ] ) ;

        return arrHouses;
    }

    /// @notice List of houses that have an invitation pending for certatin user
    /// @param _walletAddr The user address
    /// @return arrHouses List of address houses
    function GetInvitationsByUser(
        address _walletAddr
    )
        external
        view
        returns(
            address[] memory
        )
    {
        address[] memory arrHouses = new address[] ( arrCLH.length );
        uint256 indexarr = 0;
        for( uint256 did = 1 ; did <= numCLH ; did++ )
            if( 0 != arrCLH[ did ].mapInvitationMember( _walletAddr ) )
                arrHouses[ indexarr++ ] = address( arrCLH[ did ] ) ;

        return arrHouses;
    }
}
